package com.jibestream.jibestreamandroidlibrary.main;

import java.util.concurrent.atomic.AtomicInteger;

/**
 * Created by emmanuel on 2015-12-10.
 */
public class GUID {

private static final AtomicInteger GUID = new AtomicInteger(0);

public static int get() {
  return GUID.getAndIncrement();
}
}
